import { useEffect, useState } from "react";


export const CleanUp = () =>{

    const [count, setCount] = useState(1)

    useEffect(()=>{
        console.log(`Mounted or Re-Render`)
    })


    return(

        <div>
            <h1>{count}</h1>
            <button onClick={()=> setCount(count + 1)}>
                Click me!
            </button>
        </div>
    )
}
